import './Button.css'

const Button = (props) => {
    return(
        <div className="button_container">
            <button id='roll_button' class='button'>Roll Dice: <span id="dice_val_button">{props.dice_val}</span></button>
            <h3>{props.turn_val}</h3>
        </div>
    );
}

